import { StyleSheet } from "react-native";
import {theme} from "../../global/styles/theme";

export const styles = StyleSheet.create({
    conteiner:{
        width: '100%',
        height: 63,
        backgroundColor: theme.colors.primary,
        fontFamily: theme.fonts.text400,
        flexDirection: 'row',
        alignItems: 'center',
        borderRadius: 37,
        
    }
});
